INSERT INTO `shopping_goods` VALUES ('23', '2016-06-24 09:41:58', '\0', '10', '<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	先后开发出“风味豆豉、<a target=\"_blank\" href=\"http://baike.baidu.com/view/12068258.htm\">辣三丁</a>、<a target=\"_blank\" href=\"http://baike.baidu.com/view/496059.htm\">油辣椒</a>、鲜剁椒”等二十多个辣椒调味品系列，产品投放市场至来，深受广大消费者喜爱。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	“俊仁牌”老干爹辣椒品，由于辣味适度，美味可口，餐餐不离有着“辣得起、放不下”的美称。\r\n</div>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	“老干爹”公司的经营理念：在竞争中求发展，在发展中守诚信。\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	关于魔兽争霸的<a target=\"_blank\" href=\"http://baike.baidu.com/subview/20844/8013115.htm\">DOTA</a>：鉴于 SGTY.FTD在SMM的杰出表现，<a target=\"_blank\" href=\"http://baike.baidu.com/view/2204176.htm\">贵州老干爹食品有限公司</a>与<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%AE%81%E6%B3%A2%E7%9B%9B%E5%85%89%E5%A4%A9%E7%BF%BC%E7%A7%91%E6%8A%80%E6%9C%89%E9%99%90%E5%85%AC%E5%8F%B8\">宁波盛光天翼科技有限公司</a>及<a target=\"_blank\" href=\"http://baike.baidu.com/view/8495272.htm\">FTD战队</a>日前达成三方合作协议。老干爹将与盛光天翼共同赞助FTD，支持他们在电竞领域不断实现更多梦想。队伍名定为LGD.sGty，中文名老干爹。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	现今LGD-dota2战队主要成员为<a target=\"_blank\" href=\"http://baike.baidu.com/view/1053250.htm\">sylar</a>，Rotk，DDC，MMY，Maybe。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	2010年老干爹又赞助了一支拥有<a target=\"_blank\" href=\"http://baike.baidu.com/view/2507694.htm\">YamateH</a>的DOTA战队KingSurf.\r\n</div>\r\n<p>\r\n	<br />\r\n</p>', null, '87', '[]', '老干爹、风味豆豉、辣三丁、油辣椒、鲜剁椒', '99999.00', '[]', '', '3', null, '25012138', '0', '1', '0.70', 'all', '', '', '0.20', '\0', null, null, null, null, '0', '0', '0', '0', '0', '0', '65644', null, '426325', '32776', null, '0', '0', '0', null, '0', '0', '0', '0.20', '0.02', '0.00', '0.00', '0.00', null, '0', null, null, null, null, '\0', null, '\0', null);
