INSERT INTO `shopping_template` VALUES ('229386', '2013-12-21 14:43:06', '\0', '<p>\r\n	$!user.userName,您好!\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp; 您的商品$!{goods.goods_name}被管理员删除！原因是:$!reason\r\n</p>', '[给卖家]商品被管理员删除时的通知', 'msg_toseller_goods_delete_by_admin_notify', '', '商品被管理员删除时的通知', 'msg');
INSERT INTO `shopping_template` VALUES ('229387', '2013-12-21 14:45:53', '\0', '<p>\r\n	$!user.userName,您好！\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp; 您的店铺$!{store.store_name}被申请通过！\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队\r\n</p>', '[给卖家]开店申请被通过时的通知', 'msg_toseller_store_update_allow_notify', '', '开店申请通过', 'msg');
INSERT INTO `shopping_template` VALUES ('229388', '2013-12-21 14:59:19', '\0', '$!user.userName,您好！<br />\r\n<br />\r\n&nbsp;&nbsp; 您的店铺$!{store.store_name}被拒绝通过！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队', '[给卖家]开店申请被拒绝时的通知', 'msg_toseller_store_update_refuse_notify', '', '开店申请被拒绝', 'msg');
INSERT INTO `shopping_template` VALUES ('229389', '2013-12-21 15:02:50', '\0', '<p>\r\n	$!{buyer.userName},您好！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 您的订单$!{order.order_id}支付费用被卖家$!{seller.userName}调整为$!{order.totalPrice}！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{send_time}\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '[给买家]店铺调整了订单费用的邮件通知', 'email_tobuyer_order_update_fee_notify', '', '店铺调整了订单费用', 'email');
INSERT INTO `shopping_template` VALUES ('229390', '2013-12-21 15:07:29', '\0', '$!{buyer.userName},您好！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 您的订单$!{order.order_id}已经发货，物流信息为:$!{order.ship.shipping_name}，物流单号为:$!{order.shipCode},发货时间为:$!{order.shipTime}！<br />\r\n<br />\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{seller_time}\r\n</p>', '[给买家]订单已发货的邮件通知', 'email_tobuyer_order_ship_notify', '', '订单已发货的邮件通知', 'email');
INSERT INTO `shopping_template` VALUES ('229391', '2013-12-21 15:09:38', '\0', '$!{buyer.userName},您好！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 您的订单$!{order.order_id}已经被取消！<br />\r\n<br />\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{send_time}\r\n</p>', '[给买家]订单被取消的邮件通知', 'email_tobuyer_order_cancel_notify', '', '订单被取消的通知', 'email');
INSERT INTO `shopping_template` VALUES ('229392', '2013-12-21 15:16:36', '\0', '$!{buyer.userName},您好！<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp; 您的订单$!{order.order_id}已经收到线下付款，我们会及时发货哦！<br />\r\n<br />\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{config.title}运营团队\r\n</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $!{send_time}\r\n</p>', '[给买家]店铺确认收到线下支付的邮件通知', 'email_tobuyer_order_outline_pay_ok_notify', '', '店铺确认收到线下支付', 'email');
